    // b) two planes: ca0,ca1,0/0/0 and cb0,cb1,0/0/0\n    // find the intersetion line\n    // b1) build plane normals for\n    const da = cross(ca0, ca1);\n    const db = cross(cb0, cb1);\n    // prepare for d) build 90° rotated vectors\n    const da0 = cross(da, ca0);\n    const da1 = cross(da, ca1);\n    const db0 = cross(db, cb0);\n    const db1 = cross(db, cb1);\n    // b2) intersetion line\n    const p = cross(da, db);\n    // c) special case when both planes are equal\n    // = both lines are on the same greatarc. test if they overlap\n    const len2 = p[0] * p[0] + p[1] * p[1] + p[2] * p[2];\n    if (len2 < 1e-30) {\n        /* === 0 */ // b0 inside a0-a1 ?\n        const s1 = dot(cb0, da0);\n        const d1 = dot(cb0, da1);\n        if ((s1 < 0 && d1 > 0) || (s1 > 0 && d1 < 0))\n            return true;\n        // b1 inside a0-a1 ?\n        const s2 = dot(cb1, da0);\n        const d2 = dot(cb1, da1);\n        if ((s2 < 0 && d2 > 0) || (s2 > 0 && d2 < 0))\n            return true;\n        // a inside b0-b1 ?\n        const s3 = dot(ca0, db0);\n        const d3 = dot(ca0, db1);\n        if ((s3 < 0 && d3 > 0) || (s3 > 0 && d3 < 0))\n            return true;\n        return false;\n    }\n    // d) at this point we have two possible collision points\n    //    p or -p  (in 3D space)\n    // e) angel to point\n    //    since da,db is rotated: dot<0 => left, dot>0 => right of P\n    const s = dot(p, da0);\n    const d = dot(p, da1);\n    const l = dot(p, db0);\n    const f = dot(p, db1);\n    // is on side a (P)\n    if (s > 0 && 0 > d && l > 0 && 0 > f) {\n        return true;\n    }\n    // is on side b (-P)\n    if (0 > s && d > 0 && 0 > l && f > 0) {\n        return true;\n    }\n    return false;\n}\nclass GeodesicLine {\n    constructor(start, end) {\n        const d2r = Math.PI / 180.0;\n        // let r2d = 180.0 / Math.PI; //eslint-disable-line\n        // maths based on http://williams.best.vwh.net/avform.htm#Int\n        if (start.lng == end.lng) {\n            throw new Error(\"Error: cannot calculate latitude for meridians\");\n        }\n        // only the variables needed to calculate a latitude for a given longitude are stored in 'this'\n        this.lat1 = start.lat * d2r;\n        this.lat2 = end.lat * d2r;\n        this.lng1 = start.lng * d2r;\n        this.lng2 = end.lng * d2r;\n        const dLng = this.lng1 - this.lng2;\n        const sinLat1 = Math.sin(this.lat1);\n        const sinLat2 = Math.sin(this.lat2);\n        const cosLat1 = Math.cos(this.lat1);\n        const cosLat2 = Math.cos(this.lat2);\n        this.sinLat1CosLat2 = sinLat1 * cosLat2;\n        this.sinLat2CosLat1 = sinLat2 * cosLat1;\n        this.cosLat1CosLat2SinDLng = cosLat1 * cosLat2 * Math.sin(dLng);\n    }\n    isMeridian() {\n        return this.lng1 == this.lng2;\n    }\n    latAtLng(lng) {\n        lng = (lng * Math.PI) / 180; //to radians\n        let lat;\n        // if we're testing the start/end point, return that directly rather than calculating\n        // 1. this may be fractionally faster, no complex maths\n        // 2. there's odd rounding issues that occur on some browsers (noticed on IITC MObile) for very short links - this may help\n        if (lng == this.lng1) {\n            lat = this.lat1;\n        }\n        else if (lng == this.lng2) {\n            lat = this.lat2;\n        }\n        else {\n            lat = Math.atan((this.sinLat1CosLat2 * Math.sin(lng - this.lng2) -\n                this.sinLat2CosLat1 * Math.sin(lng - this.lng1)) /\n                this.cosLat1CosLat2SinDLng);\n        }\n        return (lat * 180) / Math.PI; // return value in degrees\n    }\n    // bearing in radians\n    bearing() {\n        const dLng = this.lng1 - this.lng2;\n        const cosLat2 = Math.cos(this.lat2);\n        const y = Math.sin(dLng) * cosLat2;\n        const x = this.sinLat2CosLat1 - this.sinLat1CosLat2 * Math.cos(dLng);\n        return Math.atan2(y, x);\n    }\n}\n\nlet selectedOp = null;\nfunction setSelectedOp(op) {\n    selectedOp = op;\n}\nclass WasabeeOp extends Evented {\n    constructor(obj) {\n        super();\n        this._dirtyCoordsTable = false;\n        this._batchmode = false;\n        if (typeof obj == \"string\") {\n            console.trace(\"op waits for an object\");\n            return null;\n        }\n        this.ID = obj.ID ? obj.ID : generateId();\n        this.name = obj.name ? obj.name : \"unnamed op\";\n        this.creator = obj.creator ? obj.creator : \"unset\";\n        this.anchors = obj.anchors ? Array.from(obj.anchors) : [];\n        this.links = this.convertLinksToObjs(obj.links);\n        this.markers = this.convertMarkersToObjs(obj.markers);\n        this.color = obj.color ? obj.color : \"main\";\n        this.comment = obj.comment ? obj.comment : null;\n        this.teamlist = obj.teamlist ? Array.from(obj.teamlist) : [];\n        this.fetched = obj.fetched ? obj.fetched : null;\n        this.stored = obj.stored ? obj.stored : null;\n        this.localchanged = !!obj.localchanged;\n        this.keysonhand = obj.keysonhand ? obj.keysonhand : [];\n        this.zones = this.convertZonesToObjs(obj.zones);\n        // this.modified = obj.modified ? obj.modified : null;\n        this.referencetime = obj.referencetime ? obj.referencetime : null;\n        this.lasteditid = obj.lasteditid ? obj.lasteditid : null;\n        this.remoteChanged = !!obj.remoteChanged;\n        this.server = this.fetched ? obj.server : null;\n        this.fetchedOp = obj.fetchedOp ? obj.fetchedOp : null;\n        // fix broken lasteditid by <=0.21.2 or rare occasion (leading to deadlock)\n        if (!this.server)\n            delete this.lasteditid;\n        this.background = !!obj.background;\n        if (!this.links)\n            this.links = [];\n        if (!this.markers)\n            this.markers = [];\n        const opportals = this.convertPortalsToObjs(obj.opportals);\n        this._idToOpportals = new Map();\n        this._coordsToOpportals = new Map();\n        if (opportals)\n            for (const p of opportals)\n                this._idToOpportals.set(p.id, p);\n        this.buildCoordsLookupTable();\n        // 0.20->0.21 blocker migration\n        if (obj.blockers) {\n            for (const blocker of obj.blockers) {\n                WasabeeBlocker.addBlocker(this, this.getPortal(blocker.fromPortalId), this.getPortal(blocker.toPortalId));\n            }\n        }\n        this.cleanAnchorList();\n        this.cleanPortalList();\n    }\n    static async load(opID) {\n        try {\n            const raw = await (await db).get(\"operations\", opID);\n            if (raw == null)\n                //throw new Error(\"invalid operation ID\");\n                return null;\n            const op = new WasabeeOp(raw);\n            if (op == null)\n                throw new Error(\"corrupted operation\");\n            return op;\n        }\n        catch (e) {\n            console.error(e);\n        }\n        return null;\n    }\n    static async delete(opID) {\n        delete localStorage[opID]; // leave for now\n        await (await db).delete(\"operations\", opID);\n    }\n    static async migrate(opID) {\n        // skip ones already completed\n        const have = await (await db).get(\"operations\", opID);\n        if (have != null) {\n            delete localStorage[opID]; // active now\n            return;\n        }\n        try {\n            const raw = localStorage[opID];\n            if (raw == null)\n                throw new Error(\"invalid operation ID\");\n            const obj = JSON.parse(raw);\n            const op = new WasabeeOp(obj);\n            if (op == null)\n                throw new Error(\"corrupted operation\");\n            await op.store();\n            delete localStorage[opID]; // active now\n        }\n        catch (e) {\n            console.error(e);\n        }\n    }\n    // writes to localStorage with all data included\n    async store() {\n        this.stored = Date.now